                const body = JSON.stringify({...product});
                const config ={
                    headers:{
                        "Content-Type":"application/json"
                    }
                };
                const res = await  appData.post('/products/input',body,config);
                console.log(res);
            }
           await dataCreate(menTShirtImage,menTShirtNames,'men','t-shirt');
