            await dataCreate(womenJeansImages,womenJeansNames,'women','jeans');
            await dataCreate(womenSuitsImages,womenSuitsNames,'women','suit');
            await dataCreate(boyCoatsImg,boyCoatsName,'boy','coat');
            await dataCreate(boyJacketsImg,boyJacketsName,'boy','jacket');
            await dataCreate(boyShirtsImg,boyShirtsNames,'boy','shirt');
            await dataCreate(boyTShirtsImg,boyTShirtsNames,'boy','t-shirt');
            await dataCreate(girlsLeggingsImg,girlLeggingsName,'girl','legging');
            await dataCreate(girlShirtsImg,girlsShirtsName,'girl','shirt');
            await dataCreate(girlsJeansImg,girlsJeansName,'girl','jeans');
            await dataCreate(girlsTShirtsImg,girlsTShirtsName,'girl','t-shirt');
            await dataCreate(girlsSkirtsImg,girlsSkirtsName,'girl','skirt');

        }



    };
    return (
        <div className={`container`} style={{margin:'auto',height:'50vh',width:'50vw',background:'grey'}}>
            <CustomButton onClick={onSubmit}>SUBMIT</CustomButton>
        </div>
    );
};

export default DataInput;
